import React from 'react';
import { Link } from 'react-router-dom'; // Import Link

function MainContent() {
  // Replace 'videoID' with your actual Vimeo video ID
  const videoID = 'YOUR_VIMEO_VIDEO_ID';
  const vimeoUrl = `https://player.vimeo.com/video/${videoID}?autoplay=1&loop=1&muted=1`;

  return (
    <main style={{ paddingTop: "80px", textAlign: "center" }}>

      <h1>Main Content Area</h1>
      <div style={{ overflow: 'hidden', paddingBottom: '56.25%', position: 'relative', height: 0 }}>
        <iframe
          src={vimeoUrl}
          style={{
            left: 0,
            top: 0,
            height: '100%',
            width: '100%',
            position: 'absolute',
          }}
          frameBorder="0"
          allow="autoplay; fullscreen; picture-in-picture"
          allowFullScreen
          title="Video Title"
        ></iframe>
      </div>
      {/* Replace <p> with <Link> for navigation */}
      <Link to="/about" style={{ color: 'blue', textDecoration: 'underline' }}>Go to About Page</Link>
    </main>
  );
}

export default MainContent;
